function Principal() {

    x = document.getElementById("x"); //pega a posicao inicial de x
    y = document.getElementById("y"); //pega a posicao inicial de y
    VetRobX[0] = parseFloat(x.value);
    VetRobY[0] = parseFloat(y.value);
    VetorDistancia[0] = Math.sqrt(Math.pow((VetorX[0] - VetRobX[0]), 2) + Math.pow((VetorY[0] - VetRobY[0]), 2));

    var i, n , z , a , b , c;

    for (b=0; b<170; b++){ //coloca os valores da acelleration no vetor
        acellerationBolaX[b] = 0.27;
        acellerationBolaY[b] = 0.01;
        acelleration[b] = 2.8;
    }


    for (a = 0; a<170; a++){ //calcula a velocidade da bola em X
        VelBolX[a] = (0.012*VetorTempo[a]**2) + 1.5;
    }


    for (z = 0; z<170; z++){ //calcula a velocidade da bola em Y
        VelBolY[z] = (-0.06*VetorTempo[z]) + 1.3;
    }

    for (n = 0; n < 170; n++) { //calcula a acelleration do robo

        VelRob[n] = acelleration[n] * VetorTempo[n];

        if (VelRob[n] >= veloMaxima) { //limita a velocidade do robo em veloMaxima
            VelRob[n] = veloMaxima;
            acelleration[n] = 0; //se a velocidade for maxima(constante), aceleracao é 0

        }

    }
    if (VelRob >= veloMaxima){
        acelleration = 0;
    }

    for (i = 0; i < 170; i++) {

        VetorDistancia[i] = parseFloat(Math.sqrt((Math.pow((VetorX[i] - VetRobX[i]), 2) + Math.pow((VetorY[i] - VetRobY[i]), 2))));

        cosseno[i] = parseFloat((VetorX[i] - VetRobX[i]) / VetorDistancia[i]); //acha o cosseno
        seno[i] = parseFloat((VetorY[i] - VetRobY[i]) / VetorDistancia[i]); //acha o seno


        VetRobX[i + 1] = parseFloat(VetRobX[i] + (cosseno[i] * 0.04)); //vai aumentando a posicao do robo em X
        VetRobY[i + 1] = parseFloat(VetRobY[i] + (seno[i] * 0.05)); //vai aumentando a posicao do robo em Y


        if (VetRobX[i] >= VetorX[i] - 0.112 && VetRobX[i] <= VetorX[i] + 0.112 && VetRobY[i] >= VetorY[i] - 0.112 && VetRobY[i] <= VetorY[i] + 0.112) { //hitbox - range de 0.125
            tempfinal = VetorTempo[i];

            for (c=0;c<170;c++){
                tempFinal[c] = VetorTempo[c];
                if(tempFinal[c] == tempfinal){
                    break;
                }
                    }
            break;
        }

    }
    PlotarGrafico();
}

